import React from "react";
import Navbar from "../components/navbar";
import LoginForm from "../components/loginForm";
// import Gallery from './gallery';

// login page
function Login() {
  return (
    <div>
      <Navbar />
      <div  class="d-flex justify-content-center"></div>
      <LoginForm role={"User"} />
    </div>
  );
}

export default Login;
